criteria:
Inclusion Criteria:

  -  Idiopathic Parkinson's Disease (PD) diagnosed between the ages of 30 and 85 years;

  -  Hoehn and Yahr Stage 1-3 in an "on" state;

  -  Require levodopa-containing medication regimen at least 3 times during the waking day;

  -  Experience motor fluctuations with a minimum of 2 hours of average daily "off" time
     per waking day (excluding early morning "off" time) and demonstrate levodopa
     responsiveness;

  -  Are on stable PD medication regimen;

  -  Total daily LD dose <1600 mg/day;

  -  Able to perform a spirometry maneuver in the ON and OFF states;

  -  Normal cognition confirmed by MMSE score â¥25

Exclusion Criteria:

  -  Pregnant or lactating females;

  -  Previous surgery for PD or plan to have stereotactic surgery during the study period;

  -  History of psychotic symptoms requiring treatment, or suicide ideation or attempt
     within last year;

  -  Known contraindication to the use of levodopa;

  -  Any significant condition, severe concurrent disease, abnormality or finding that
     would make patients unsuitable or may compromise patient safety;

  -  Any contraindication to performing routine spirometry.

Inclusion Criteria:

  -  Meets the National Institute of Neurological and Communicative Disorders and
     Stroke/Alzheimer's Disease and Related Disorders Association criteria for probable
     Alzheimer's disease (AD);

  -  Has a Mini-Mental State Examination total score of 16 to 26;

  -  Has a Modified Hachinski Ischemia Scale score of â¤ 4;

  -  Is taking a stable dose of donepezil, galantamine or rivastigmine for at least 30
     days;

  -  Has had a computerized tomography or magnetic resonance imaging. The scan must not
     show evidence for an alternative etiology for dementia;

  -  With the exception of a diagnosis of mild-to-moderate AD and the presence of stable
     medical conditions, is in general good health.

Exclusion Criteria:

  -  Positive screen for drugs of abuse, alcohol or cotinine;

  -  Females must not have positive results for pregnancy;

  -  Focal neurological signs on examination;

  -  Has a clinically significant abnormal value, in serum chemistry, hematology or
     urinalysis;

  -  History of any significant neurologic disease other than AD;

  -  History of head trauma, motor vehicle accident, concussion.

Inclusion Criteria:

  -  Signed a current IRB/REB/IEC-approved informed consent form;

  -  Parkinson's disease, per UK Parkinson's Disease Society (UKPDS) Brain Bank Clinical
     Diagnostic Criteria;

  -  On a stable regimen of antiparkinson's medications for at least 30 days prior to
     screening, including a levodopa preparation administered not less than three times
     daily, and willing to continue the same doses and regimens during study participation;

  -  Following diary training, the subject is willing and able to understand and complete
     the 24-hour PD home diary (trained caregiver/study partner assistance allowed);

  -  Any other current and allowed prescription/non-prescription medications and/or
     nutritional supplements taken regularly must have been at a stable dose and regimen
     for at least 30 days prior to screening, and subject must be willing to continue the
     same doses and regimens during study participation (this criterion does not apply to
     medications that are being taken pre-study only on an as-needed basis);

Exclusion Criteria:

  -  History of neurosurgical intervention related to Parkinson's disease (e.g. deep brain
     stimulation);

  -  History of seizures within 2 years prior to screening;

  -  History of stroke or TIA within 2 years prior to screening;

  -  History of cancer within 5 years prior to screening, with the following exceptions:
     adequately treated non-melanomatous skin cancers, localized bladder cancer,
     non-metastatic prostate cancer, in situ cervical cancer, or other definitively treated
     cancer that is considered cured;

  -  Presence of cognitive impairment, as evidenced by a Mini-Mental Status Examination
     (MMSE) score of less than 24 during screening;

  -  If female, is pregnant or lactating;

  -  If a sexually active female, is not surgically sterile or at least 2 years
     post-menopausal, or does not agree to utilize an effective method of contraception
     from screening through at least 4 weeks after the completion of study treatment, using
     one of the following: barrier methods (diaphragm or partner using condoms plus use of
     spermicidal jelly or foam, preferably double-barrier methods); oral or implanted
     hormonal contraceptive; intrauterine device (IUD); or vasectomized male partner;

  -  Treatment with an investigational drug or device within 30 days prior to screening;

  -  Treatment with an investigational biologic within 6 months prior to screening;

  -  Current participation in another clinical trial;

Inclusion Criteria:

  -  CAG repeat equal or greater than 36;

  -  Total motor score equal or greater than 10;

  -  Total functional capacity equal or greater than 7.

Exclusion Criteria:

  -  Clinically significant neurologic disorder other than Huntington's disease;

  -  Other severe acute psychiatric conditions, mania and/or psychosis;

  -  History of neutropenia, and myeloproliferative disorders;

Key Inclusion Criteria:

  -  Willing and able to give informed consent prior to any study specific procedures being
     performed. In individuals with hepatic encephalopathy (HE) which may impair
     decision-making, consent will be obtained per hospital procedures (eg, by Legally
     Authorized Representative)

  -  Clinical diagnosis of severe AH

       -  Maddrey's Discriminant Function (DF) â¥ 32 at screening

Key Exclusion Criteria:

  -  Pregnant or lactating females;

  -  Other causes of liver disease including chronic hepatitis B (hepatitis B surface
     antigen [HBsAg] positive), chronic hepatitis C (HCV RNA positive), acetaminophen
     hepatotoxicity, biliary obstruction, and autoimmune liver disease;

  -  Serum aspartate aminotransferase (AST) >400 U/L or alanine aminotransferase (ALT) >300
     U/L;

  -  Model for End Stage Liver Disease (MELD) >30 at screening;

  -  Maddrey's DF >60 at screening;

  -  Grade 4 Hepatic Encephalopathy (HE) by West Haven criteria;

  -  Concomitant or previous history of hepatocellular carcinoma;

  -  History of liver transplantation;

  -  HIV Ab positive;

  -  Clinical suspicion of pneumonia;

  -  Uncontrolled sepsis;

  -  Uncontrolled gastrointestinal (GI) bleeding or controlled GI bleeding within 7 days of
     screening that was associated with shock or required transfusion of more than 3 units
     of blood;

  -  Type 1 hepatorenal syndrome (HRS) or renal failure defined as a serum creatinine >221
     Î¼mol/L (>2.5 mg/dL) or the requirement for renal replacement therapy;

  -  Individuals dependent on inotropic (eg, epinephrine or norepinephrine) or ventilatory
     support (ie, endotracheal intubation or positive-pressure ventilation);

  -  Portal vein thrombosis;

  -  Acute pancreatitis;

  -  Cessation of alcohol consumption for more than 2 months before Baseline/ Day 1

Note: Other protocol defined Inclusion/ Exclusion criteria may apply.

Main Inclusion Criteria:

  -  For male or female with reproductive potential, use of reliable means of
     contraception;

  -  RRMS according to the 2010 revised McDonald criteria;

  -  Disease activity characterised by at least one documented relapse within the last 12
     months and /or at least one Gd-enhancing T1 lesion at selection or evidenced within
     the last 3 months;

  -  EDSS score < 6.0.

Main Exclusion Criteria:

  -  Patients suffering from Secondary Progressive MS and Primary Progressive MS at
     screening;

  -  Pregnant and nursing women.
